import React from 'react'
import { pushData } from '../js/actions'
import store from '../js/store'

const PageThree = (props) => {
  return (
    <div>
      <button onClick={ () => store.dispatch(pushData, 'test') }>click</button>
    </div>
  )
}

export default PageThree
